import React,{Component} from 'react';
import Table from 'react-bootstrap/Table'
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      progressValue: 'hello',
    };
  }
  componentDidMount() {
    fetch('http://localhost:4000/properties')
    .then(res => res.json())
    .then((data) => {
      this.data = data;
      this.hello="gellloooona";
      console.log(this.data);
    })
    .catch(console.log)
  }
  render() {
    const { progressValue } = this.state;
    return (
        {progressValue}
    );
  }
}

export default App;
